('node/add/page', '', '', 'node_access', 'a:2:{i:0;s:6:"create";i:1;s:4:"page";}', 'node_add', 'a:1:{i:0;i:2;}', 7, 3, '', 'node/add/page', 'Stránka', 'check_plain', '', 6, '', '<em>Stránka</em> je jednoduchá metoda vytváření a zobrazování informací, které se zřídka mění, jako sekce webu „O nás“. Ve výchozím nastavení <em>stránka</em> neumožňuje návštěvníkům psát komentáře a neobjevuje se na úvodní stránce webu.', '', 0, 'modules/node/node.pages.inc'),
